  display:flex;
  flex-direction:column;
  height:100%;
  width:100%;
  margin:18px;
  max-width:200px;

`;

export const ImagemOportu  = styled.img`
    flex-basis: 243px;
    min-height: 243px;
    width: 100%;
    max-width:200px;
    height: auto;
    border-top-left-radius: 4px;
    border-top-right-radius: 4px;
    object-fit: cover;
    margin:18px;
